import { Route,Routes } from "react-router-dom"
import Home from './Routes/Home';
import Products from './Routes/Product';



function App() {
  return (
    <div className="App">
      <Navbar/>
      <Routes>

      <Route path="/" element={<Home />} />
      <Route path="/" element={<Product />} />

      </Routes>
      {/* <Banner/> 
      <Info/>
      <FeaturedCollections/>
      <CategorySection/> */}

    </div>
  );
}

export default App;
